import React, {createRef} from "react";

class Region extends React.Component{
    constructor(props) {
        super(props);
        this.props = props;

    }
    componentDidMount() {
        this.g = createRef();
    }

    render() {
        alert(this.g.current)
        return(
            <g ref={this.g}>
                <rect  height="10" width="10"   fill="#fff"/>
                <path fill={this.props.data.color} d={this.props.data.d}/>
            </g>
        );
    }
}
export default Region;
